import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const FooterContainer = styled.div`
    background-color: #f7f7f7;
    height:480px;
    padding:60px 80px;

    .footerInner{
      background-color: #00f5;
      width:100%;
      height:100px;
      display: flex;

      .footerInfo{
        background-color: #ff0;
        width:60%;
      }

      .footerMenu{
        background-color: #f60;
        width:40%;

      }
    }
`;

const Footer = memo(() => {

  const {footerInfo, subInfo} = dataset.footer;
  return (
    <FooterContainer>
      <div className='footerInner'>
        <div className='footerInfo'>
          <h1>1670-9600</h1>
          <p>상담시간 : 오전 10시~오후 5시(토요일, 공휴일 휴무)</p>
          <p>email : spao@eland.co.kr(단체주문 문의)</p>
          <p>email : spao_mkt@eland.co.kr(마케팅 협찬 문의)</p>

        </div>
        <div className='footerMenu'></div>
      </div>
    </FooterContainer>
  );
});

export default Footer;
